///                                    * Audio DAC enable bit. This bit controls the analog section of audio DAC.
///                                    * DAC_EN = '0': DAC is powered down;
///                                    * DAC_EN = '1': DAC is powered up.
///                                    ###
///               %unsigned 1  MODE_SEL                  0x0
